import React from "react";
import FulsoreLogo from "../../assets/fulsorelogo.jpeg";

function Navbar() {
  return (
    <div>
      {/* upper Navbar */}
      <div className="shadow-md bg-white dark:bg-gray-900">
        <div className="bg-green-300 py-2">
          <div className="flex justify-between items-center max-h-max">
            {/* Logo and name section */}
            <a
              href="LoGo"
              className="font-bold text-2xl sm:text-3xl flex items-center gap-2"
            >
              <img
                className="w-10 m-3 rounded-full"
                src={FulsoreLogo}
                alt="LOGO"
              />
              Fulsore
            </a>
            {/* Brand */}
            <div>
              <div>
                <h1 className="text-center fles justify-between font-bold">
                  SMART FRAM
                </h1>
              </div>
            </div>
            {/* Search bar section */}
            <div>
              <input
                type="text"
                placeholder="search"
                className="w-[150px] sm:w-[300px] group-hover:w-[300px] transition-all duration-300 rounded-full px-4 py-1 focus:outline-none focus:border-1 focus:border-blue-400"
              />
            </div>
          </div>
        </div>
      </div>
      {/* lower navbar */}
      <div></div>
    </div>
  );
}

export default Navbar;
